import{_ as e,c as a,o as t,a as d}from"./app.52f6ae9a.js";const v=JSON.parse('{"title":"\u6B22\u8FCE\u6765\u5230\u6211\u7684\u535A\u5BA2~","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u6700\u7231\u7684Vue","slug":"\u6700\u7231\u7684vue"},{"level":2,"title":"\u540E\u6765\u5C45\u4E0A\u7684React","slug":"\u540E\u6765\u5C45\u4E0A\u7684react"},{"level":2,"title":"\u7531\u6D45\u5165\u6DF1","slug":"\u7531\u6D45\u5165\u6DF1"}],"relativePath":"index.md"}'),c={name:"index.md"},r=d('<h1 id="\u6B22\u8FCE\u6765\u5230\u6211\u7684\u535A\u5BA2" tabindex="-1">\u6B22\u8FCE\u6765\u5230\u6211\u7684\u535A\u5BA2~ <a class="header-anchor" href="#\u6B22\u8FCE\u6765\u5230\u6211\u7684\u535A\u5BA2" aria-hidden="true">#</a></h1><hr><p>\u6211\u662F\u4E00\u4E2A\u56DB\u5E74\u5F00\u53D1\u7ECF\u9A8C\u7684\u524D\u7AEF\u5F00\u53D1\u5DE5\u7A0B\u5E08\uFF0C\u56DB\u5E74\u7684\u5F00\u53D1\u5DE5\u4F5C\u4E2D\uFF0C\u51FA\u73B0\u8FC7\u5F88\u591A\u96F6\u96F6\u6563\u6563\u7684\u95EE\u9898\uFF0C\u81EA\u5DF1\u4E5F\u53BB\u627E\u4E86\u5404\u65B9\u7684\u529E\u6CD5\u89E3\u51B3\u5B83\uFF0C\u4E5F\u505A\u8FC7\u4E00\u4E9B\u65E5\u8BB0\u5F62\u5F0F\u7684\u5F52\u7EB3\u603B\u7ED3\uFF0C\u4F46\u662F\u8FC7\u4E86\u592A\u4E45\u65F6\u95F4\u6700\u540E\u90FD\u627E\u4E0D\u89C1\u90A3\u4E9B\u5B9D\u8D35\u7684\u8BB0\u5F55\u4E86\uFF0C \u6240\u4EE5\uFF0C\u6700\u8FD1\u5F00\u59CB\u4E0B\u51B3\u5FC3\u4E3A\u81EA\u5DF1\u7684\u5DE5\u4F5C\u505A\u4E00\u4E2A\u5C0F\u5C0F\u7684\u5F52\u7EB3\u6574\u7406\uFF0C\u5E0C\u671B\u7ECF\u8FC7\u8FD9\u4E9B\u79EF\u7D2F\u6C89\u6DC0\uFF0C\u80FD\u8BA9\u81EA\u5DF1\u8D8A\u53D1\u5F3A\u5927\uFF0C\u72EC\u5F53\u4E00\u9762\uFF01\u52A0\u6CB9 ~ <div style="text-align:right;">2022-07-27</div> \u4E24\u5E74\u8FC7\u53BB\u540E\uFF0C\u6211\u7684\u6280\u672F\u4E5F\u6709\u6240\u89C1\u957F\uFF0C\u4ECE\u4E24\u5E74\u524D\u7684\u53EA\u6562\u53BB\u5C1D\u8BD5\u81EA\u5DF1\u80FD\u628A\u63E1\u7684Vue\u6280\u672F\u6808\uFF0C\u5230\u4ECA\u5929\u7684\u4E09\u4E2A\u6280\u672F\u6808\u90FD\u6709\u6240\u6D89\u730E\uFF0C\u5C24\u5176\u5728\u5C1D\u8BD5\u8FC7React\u4E4B\u540E\uFF0C\u5BF9\u65B0\u9C9C\u7684jsx\u5199\u6CD5\u5F88\u611F\u5174\u8DA3\uFF0C\u4E5F\u5199\u4E86\u597D\u51E0\u4E2AReact\u9879\u76EE\u5145\u5B9E\u81EA\u5DF1\uFF0C\u65B0\u589E\u4E86\u51E0\u4E2A\u65B0\u7684\u6280\u672F\u6808\uFF0C\u7279\u6B64\u5206\u4EAB\u7ED9\u8BFB\u8005\uFF1B\u5E0C\u671B\u770B\u5230\u535A\u5BA2\u7684\u8BFB\u8005\u4E5F\u80FD\u5728\u81EA\u5DF1\u7684\u5F00\u53D1\u751F\u6DAF\u4E2D\u4E0D\u65AD\u63D0\u5347\u3001\u4E0D\u65AD\u5145\u5B9E\u3001\u4E0D\u65AD\u5206\u4EAB\u3002 <div style="text-align:right;">2024-10-15</div> \u5F15\u7528\u4E00\u53E5\u5409\u59C6\u7F57\u6069\u7684\u8BDD\u5427\uFF1A</p><p><code>\u5927\u591A\u6570\u4EBA\u90FD\u9AD8\u4F30\u4E86\u81EA\u5DF1\u4E00\u5E74\u5185\u80FD\u505A\u5230\u7684\u4E8B\u60C5 \u4E5F\u4F4E\u4F30\u4E86\u81EA\u5DF1\u5341\u5E74\u5185\u80FD\u505A\u5230\u7684\u4E8B\u60C5\u3002 \u2014\u2014\u5409\u59C6.\u7F57\u6069</code></p><h2 id="\u6700\u7231\u7684vue" tabindex="-1">\u6700\u7231\u7684Vue <a class="header-anchor" href="#\u6700\u7231\u7684vue" aria-hidden="true">#</a></h2><p>\u535A\u5BA2\u7684\u5F00\u59CB\uFF0C\u6211\u51C6\u5907\u4E86\u4E00\u4E2A\u6211\u5E38\u7528\u7EC4\u4EF6\u2014\u2014\u2014<code>Vue</code>\uFF0C\u5E0C\u671B\u80FD\u4EE5\u4ED6\u4E3A\u57FA\u7840\uFF0C\u5C31\u50CF\u4ED6\u5F53\u521D\u5145\u5B9E\u6211\u7684\u5F00\u53D1\u65C5\u7A0B\u4E00\u6837\uFF0C\u73B0\u5728\u4E5F\u6765\u5145\u5B9E\u6211\u7684\u535A\u5BA2\u5185\u5BB9\uFF0C\u76EE\u524D\u9047\u5230\u7684\u4E00\u4E9B\u7EC6\u5C0F\u95EE\u9898\uFF0C\u8FD8\u5728\u6574\u7406\u4E2D\uFF0C\u6211\u5E0C\u671B\u80FD\u603B\u7ED3\u5730\u66F4\u597D\u3001\u66F4\u8BED\u4E49\u5316\u3001\u65B9\u4FBF\u9605\u8BFB\uFF0C\u624D\u80FD\u5E2E\u52A9\u5230\u66F4\u591A\u7684\u4EBA\u3002</p><h2 id="\u540E\u6765\u5C45\u4E0A\u7684react" tabindex="-1">\u540E\u6765\u5C45\u4E0A\u7684React <a class="header-anchor" href="#\u540E\u6765\u5C45\u4E0A\u7684react" aria-hidden="true">#</a></h2><p>\u4E24\u5E74\u540E\u7684\u4ECA\u5929\uFF0C\u6211\u5DF2\u4F7F\u7528<code>react</code>\u4E00\u6BB5\u65F6\u95F4\uFF0C\u501F\u6B64\u8C08\u8C08\u81EA\u5DF1\u7684\u4E86\u89E3\u548C\u5FC3\u5F97\uFF1B<br><code>React</code> \u7B80\u5355\u6765\u8BF4\u53EA\u662FMVC\u4E2D\u7684\uFF08view\uFF09\u5C42\uFF0C\u751A\u81F3React\u5E76\u4E0D\u975E\u5E38\u8BA4\u53EFMVC\u5F00\u53D1\u6A21\u5F0F\uFF1BReact\u6784\u5EFA\u9875\u9762UI\u7684\u5E93\u3002\u53EF\u4EE5\u7B80\u5355\u5730\u7406\u89E3\u4E3A\uFF0CReact\u5C06\u754C\u9762\u5206\u6210\u4E86\u5404\u4E2A\u72EC\u7ACB\u7684\u5C0F\u5757\uFF0C\u6BCF\u4E00\u4E2A\u5757\u5C31\u662F\u7EC4\u4EF6\uFF0C\u8FD9\u4E9B\u7EC4\u4EF6\u4E4B\u95F4\u53EF\u4EE5\u7EC4\u5408\u3001\u5D4C\u5957\u3001\u5C31\u6210\u4E86\u6211\u4EEC\u7684\u9875\u9762\uFF0C\u8FD9\u4FBF\u662F\u4ED6\u7684\u7EC4\u4EF6\u5316\u7279\u6027\uFF1B<br><code>\u865A\u62DFdom</code>\u4E5F\u662F\u4ED6\u7684\u7279\u70B9\u4E4B\u4E00\uFF0C\u5E76\u4E14\u5728\u8FD1\u51E0\u4E2A\u7248\u672C\u8FED\u4EE3\u4E86\u65B0\u7684\u66F4\u65B0dom\u7B97\u6CD5\uFF0C\u5728react16\u540E\uFF0C\u66F4\u65B0\u4E3A<code>React Fiber</code>\uFF0C\u4E4B\u524D\u4F9D\u7136\u4F7F\u7528\u7684<code>diff</code>\u7B97\u6CD5\uFF0C\u5728vue\u4E5F\u89C1\u5230\u8FC7\u5B83\uFF1B<br><code>Jsx</code>\u8BED\u6CD5\u4E5F\u662F\u5B83\u7684\u4E00\u5927\u7279\u70B9\uFF0C\u5728vue\u4E2D\uFF0C\u6211\u4EEC\u4F7F\u7528<code>render</code>\u51FD\u6570\u6765\u6784\u5EFA\u7EC4\u4EF6\u7684dom\u6784\u9020\u6027\u80FD\u8F83\u9AD8\uFF0C\u56E0\u4E3A\u7701\u53BB\u4E86\u67E5\u627E\u548C\u7F16\u8BD1\u6A21\u677F\u7684\u8FC7\u7A0B\uFF0C\u4F46\u662F\u5728render\u4E2D\u5229\u7528<code>createElement</code>\u521B\u5EFA\u7ED3\u6784\u7684\u65F6\u5019\u4EE3\u7801\u53EF\u8BFB\u6027\u8F83\u4F4E\uFF0C\u8F83\u4E3A\u8D1F\u8F7D\uFF0C\u6B64\u65F6\u53EF\u4EE5\u5229\u7528JSX\u8BED\u6CD5\u6765\u5728render\u4E2D\u521B\u5EFAdom\uFF0C\u89E3\u51B3\u4E86\u8FD9\u4E2A\u95EE\u9898\uFF0C\u4F46\u662F\u524D\u63D0\u662F\u9700\u8981\u4F7F\u7528\u5DE5\u5177\u7F16\u8BD1jsx\uFF0C\u8FD9\u4E2A\u5728\u6211\u4EEC\u7684\u5F00\u53D1\u4E2D\u4E0D\u6210\u95EE\u9898\uFF1B</p><h2 id="\u7531\u6D45\u5165\u6DF1" tabindex="-1">\u7531\u6D45\u5165\u6DF1 <a class="header-anchor" href="#\u7531\u6D45\u5165\u6DF1" aria-hidden="true">#</a></h2><p>\u6211\u4F1A\u4E0D\u65AD\u5730\u5145\u5B9E\u535A\u5BA2\u5185\u5BB9\uFF0C\u4ECE\u4E00\u4E9B\u8F83\u4E3A\u57FA\u7840\u7684\u4FE1\u606F\u5F00\u59CB\uFF0C\u5F88\u8363\u5E78\u80FD\u5728\u6211\u7684\u535A\u5BA2\u9047\u5230\u4F60\uFF0C\u5E0C\u671B\u9605\u8BFB\u6211\u7684\u535A\u5BA2\u53EF\u4EE5\u4E3A\u4F60\u89E3\u51B3\u76EE\u524D\u9047\u5230\u7684\u95EE\u9898\u6216\u8005\u662F\u589E\u52A0\u4E00\u4E9B\u65B0\u7684\u77E5\u8BC6\u5427\uFF0C\u4E5F\u5E0C\u671B\u6211\u4EEC\u80FD\u4E92\u76F8\u5171\u52C9\uFF0C\u4FDD\u6301\u70ED\u7231\u4E0E\u5B66\u4E60\u7684\u5FC3\uFF0C\u63A5\u4E0B\u6765\uFF0C\u5C31\u8BF7\u9605\u89C8\u6211\u7684\u535A\u5BA2\u5185\u5BB9\u5427~</p>',10),o=[r];function i(n,s,h,l,_,p){return t(),a("div",null,o)}var x=e(c,[["render",i]]);export{v as __pageData,x as default};
